import "./Skills.css";

export function Skills() {
  class SkillsSection {
    title: string;
    desc: string;
    skillList: string[];

    constructor(title: string, desc: string, skillList: string[]) {
      this.title = title;
      this.desc = desc;
      this.skillList = skillList;
    }

    openLink = (openLink: string) => {
      window.open(openLink);
    };

    display() {
      return (
        <div className="skills-section">
          <div className="skills-subtitle">{this.title}</div>
        </div>
      );
    }
  }

  let sectionOne = new SkillsSection("Web Development", "Test", [""]);
  let sectionTwo = new SkillsSection("Mobile Development", "Test", [""]);

  return (
    <div id="skills" className="skills-page flex">
      <div className="skills-page-container screen-max">
        <div className="skills-title section-title">
          Skills<span> .</span>
        </div>

        {sectionOne.display()}
        {sectionTwo.display()}
      </div>
    </div>
  );
}
